import React from "react";
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import '../assets/styles/Main.scss';

function Main() {
  return (
    <div className="hero-container">
      <div className="hero-grid">

        {/* TILE 1: Identity & Badge */}
        <div className="hero-tile identity-card">
          <div className="status-badge">
            <span className="dot"></span>
            Open for SWE & Data Roles
          </div>
          <h1>Shailee Patel</h1>
          <p className="subtitle">Building Scalable Digital Infrastructure</p>
          <div className="hero-socials">
            <a href="https://github.com/shaileep99" target="_blank" rel="noreferrer"><GitHubIcon/></a>
            <a href="https://www.linkedin.com/in/shailee-patel/" target="_blank" rel="noreferrer"><LinkedInIcon/></a>
          </div>
        </div>

        {/* TILE 2: Quick Bio */}
        <div className="hero-tile bio-card">
          <p>
            MS in Computer Science candidate specialized in <strong>Distributed Systems</strong> and <strong>Data Engineering</strong>.
            Turning high-throughput telemetry into actionable insights.
          </p>
        </div>

        {/* TILE 3: Interactive Tech "Loop" */}
        <div className="hero-tile tech-loop-card">
          <h3>Core Expertise</h3>
          <div className="tech-marquee">
            <span>AWS Kinesis</span> <span>Java</span> <span>Python</span> <span>PostgreSQL</span>
          </div>
        </div>

      </div>
    </div>
  );
}

export default Main;
